import { useState, useEffect } from "react";
import { Form, Button } from "react-bootstrap";
import axios from "axios";
import { useNavigate, useParams } from "react-router-dom";
import { API_URL } from "../utils/value.js";

function CarForm() {
  const [brand, setBrand] = useState("");
  const [model, setModel] = useState("");
  const [year, setYear] = useState("");
  const [price, setPrice] = useState("");
  const [gearbox, setGearbox] = useState("");
  const [fuel, setFuel] = useState("");
  const [image, setImage] = useState(null);
  const [available, setAvailable] = useState(true);

  const { id } = useParams();
  const isEdit = id !== undefined;

  const navigate = useNavigate();

  useEffect(() => {
    if (isEdit) {
      // Fetch the car data by id from the server and set the form data
      axios
        .get(`${API_URL}/cars/${id}`)
        .then((res) => {
          const { brand, model, year, price, gearbox, fuel, image, available } = res.data;
          setBrand(brand);
          setModel(model);
          setYear(year);
          setPrice(price);
          setGearbox(gearbox);
          setFuel(fuel);
          setImage(image);
          setAvailable(available);
        })
        .catch((err) => {
          console.error(err);
          alert("Error fetching car data");
          navigate("/"); // Navigate to home page
        });
    }
  }, [id, isEdit, navigate]);

  const handleSubmit = async (event) => {
    event.preventDefault();

    const formData = new FormData();
    formData.append("brand", brand);
    formData.append("model", model);
    formData.append("year", year);
    formData.append("price", price);
    formData.append("gearbox", gearbox);
    formData.append("fuel", fuel);
    formData.append("image", image);
    formData.append("available", available);

    try {
      const response = isEdit
        ? await axios.put(`${API_URL}/cars/${id}`, formData)
        : await axios.post(`${API_URL}/cars`, formData);
      console.log(response.data);
      alert(`Car ${isEdit ? "updated" : "added"} successfully`);
      navigate("/"); // Navigate to home page
    } catch (error) {
      console.log(error.response.data);
      alert(`Error ${isEdit ? "updating" : "adding"} car`);
    }
  };

  return (
    <Form onSubmit={handleSubmit} className="mx-auto mt-5 p-4 rounded">
      <h4 className="text-center mb-4">Add Car</h4>
      <Form.Group controlId="formBrand">
        <Form.Label className="form-label">Brand</Form.Label>
        <Form.Control
          type="text"
          placeholder="Enter brand"
          value={brand}
          onChange={(event) => setBrand(event.target.value)}
          className="form-control"
        />
      </Form.Group>
      <Form.Group controlId="formModel">
        <Form.Label className="form-label">Model</Form.Label>
        <Form.Control
          type="text"
          placeholder="Enter model"
          value={model}
          onChange={(event) => setModel(event.target.value)}
          className="form-control"
        />
      </Form.Group>
      <Form.Group controlId="formYear">
        <Form.Label className="form-label">Year</Form.Label>
        <Form.Control
          type="number"
          placeholder="Enter year"
          value={year}
          onChange={(event) => setYear(event.target.value)}
          className="form-control"
        />
      </Form.Group>
      <Form.Group controlId="formPrice">
        <Form.Label className="form-label">Price</Form.Label>
        <Form.Control
          type="number"
          placeholder="Enter price"
          value={price}
          onChange={(event) => setPrice(event.target.value)}
          className="form-control"
        />
      </Form.Group>
      <Form.Group controlId="formGearbox">
        <Form.Label className="form-label">Gearbox</Form.Label>
        <Form.Control
          type="text"
          placeholder="Enter gearbox"
          value={gearbox}
          onChange={(event) => setGearbox(event.target.value)}
          className="form-control"
        />
      </Form.Group>
      <Form.Group controlId="formFuel">
        <Form.Label className="form-label">Fuel</Form.Label>
        <Form.Control
          type="text"
          placeholder="Enter fuel"
          value={fuel}
          onChange={(event) => setFuel(event.target.value)}
          className="form-control"
        />
      </Form.Group>
      <Form.Group controlId="formImage">
        <Form.Label className="form-label">Image</Form.Label>
        <Form.Control
          type="file"
          onChange={(event) => setImage(event.target.files[0])}
          className="form-control"
        />
      </Form.Group>
      <Form.Group controlId="formAvailable">
        <Form.Check
          type="checkbox"
          label="Available"
          checked={available}
          onChange={(event) => setAvailable(event.target.checked)}
        />
      </Form.Group>
      <Button variant="primary" type="submit" className="btn-primary mt-3">
        Submit
      </Button>
    </Form>
  );
}

export default CarForm;
